import './App.css';
import Logement from './component/Logement';
import React, { useState, useEffect } from 'react';


function App() {

  const [logement, setLogement] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8000/getlogement")
      .then((res) => res.json())
      .then((data) => {
        const loge = data.map((tuple) => ({
          adresse: tuple[3],
          nb_pieces: tuple[4],
          type: tuple[5],
          surface: tuple[6],
          etat: tuple[7],
          objectif_gestion: tuple[8],
          date_dispo: tuple[9],
          prix: tuple[10]
        }));
        setLogement(loge);
      })
      .catch((error) => console.error(error));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h2>Base de donn√©e - (ALIF62)</h2>
      </header>
      <body className="App-body">
        <Logement props={logement}/>
      </body>
    </div>
  );
}

export default App;
